import{_ as e,c as i,o as t,ab as a}from"./chunks/framework.CUflZczI.js";const h=JSON.parse('{"title":"WiFi Телеметрійне радіо","description":"","frontmatter":{},"headers":[],"relativePath":"uk/telemetry/telemetry_wifi.md","filePath":"uk/telemetry/telemetry_wifi.md"}'),r={name:"uk/telemetry/telemetry_wifi.md"},l=a('<h1 id="wifi-телеметріине-радіо" tabindex="-1">WiFi Телеметрійне радіо <a class="header-anchor" href="#wifi-телеметріине-радіо" aria-label="Permalink to &quot;WiFi Телеметрійне радіо&quot;">​</a></h1><p>WiFi телеметрія дозволяє здійснювати комунікацію MAVLink між WiFi радіо на транспортному засобі та GCS.<br> WiFi зазвичай пропонує менший діапазон, ніж звичайне телеметрійне радіо, але підтримує вищі швидкості передачі даних і полегшує підтримку FPV/відеопотоків. Зазвичай для транспортного засобу потрібен лише один радіоприймач (з умовою, що наземна станція вже має WiFi).</p><p>PX4 підтримує телеметрію через UDP та Wifi. Він транслює сигнал серцебиття на порт 14550 за адресою 255.255.255.255, доки не отримає перший сигнал серцебиття від земної станції керування, після чого він буде надсилати дані лише на цю земну станцію керування.</p><p>Сумісні модулі телеметрії WiFi включають в себе:</p><ul><li><a href="./../telemetry/esp8266_wifi_module.html">Модуль WiFi ESP8266</a></li><li><a href="./../telemetry/esp32_wifi_module.html">Модуль WiFi ESP32</a></li><li><a href="./../telemetry/3dr_telemetry_wifi.html">3DR Телеметр Wifi</a> (Скасовано)</li></ul>',5),_=[l];function o(m,s,f,n,c,d){return t(),i("div",null,_)}const u=e(r,[["render",o]]);export{h as __pageData,u as default};
